/**
 * Navibar
 * Created for IT PROJECT 2019
 * Group : Odin's Army
 * Initial commit/file creation by Xiaoxuan Li - ID: 933206, Sep 4, 2019
 **/

import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import "bootstrap/dist/css/bootstrap.min.css";
import user_icon from "./user_icon.png";
import "./Navibar.css"
import Profile from './Profile'

class Navibar extends Component {
    render(){
        return(
          <nav className="navbar">
          <div>
            <NavLink to="/" className="navbar-brand" >Shanmuganathan Registry</NavLink>
            <NavLink to="/UserModal" className="navbar-brand">
              <img className="user_icon" src={user_icon} width="40" height="40" alt="Profile"  />
            </NavLink>
          </div>
          </nav>
        );
    }
}

export default Navibar;
